import './Lorem.css'
import React from 'react'

export default function Lorem() {
  return (
    <div className='Lorem'>
        <h1 className='Lorem-title'>لورم ایپسوم متن ساختگی با تولید سادگی نامفهوم از صنعت چاپ و با استفاده از طراحان گرافیک است</h1>
        <button className='Lorem-btn'>ثبت نام</button>
    </div>
  )
}
